pragma solidity ^0.8.7;

import "./ERC721A.sol";
import "./MetaTransaction/NativeMetaTransaction.sol";
import "./MetaTransaction/ContextMixin.sol";
import "./Lockable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract CybeeNFT is
    ERC721A,
    NativeMetaTransaction,
    Ownable,
    Pausable,
    Lockable,
    ContextMixin
{
    uint256 public maxSupply;
    string public baseURI;

    uint256 public maticPrice = 40 ether;
    uint256 public tokenPrice = 0.02 ether;
    IERC20 public paymentToken =
        IERC20(0x7ceB23fD6bC0adD59E62ac25578270cFf1b9f619);
    uint256 public phasedSalesCount = 10000;

    mapping(address => bool) private _minters;

    event MinterAdded(address minter);
    event MinterRemoved(address minter);

    constructor(string memory _uri, uint256 _maxSupply)
        ERC721A("CybeeDAO", "CYBEE")
    {
        maxSupply = _maxSupply;
        setBaseURI(_uri);
        _lock();
        _initializeEIP712("CybeeDAO");
    }

    function mint(address to, uint256 count) public payable whenNotPaused {
        require(totalSupply() + count <= maxSupply, "Exceeds max supply");

        if (isMinter(_msgSender())) {
            // Cross-chain (Ethereum) mint
        } else if (msg.value > 0) {
            // Matic mint
            require(
                msg.value >= maticPrice * count,
                "Insufficient MATIC payment"
            );
        } else {
            // Token mint
            require(
                paymentToken.transferFrom(
                    _msgSender(),
                    address(this),
                    tokenPrice * count
                )
            );
        }

        checkPhasedSales(count);
        _safeMint(to, count);
    }

    function checkPhasedSales(uint256 count) internal {
        if (totalSupply() >= phasedSalesCount) {
            return;
        }
        if (totalSupply() + count == phasedSalesCount) {
            _pause();
        }
        if (totalSupply() + count > phasedSalesCount) {
            revert("Exceeds phased sales limit");
        }
    }

    function setPhasedSalesCount(uint256 count) public {
        phasedSalesCount = count;
    }

    function setBaseURI(string memory newBaseURL) public onlyOwner {
        baseURI = newBaseURL;
    }

    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function setMaticPrice(uint256 price) public onlyOwner {
        maticPrice = price;
    }

    function setTokenPrice(uint256 price) public onlyOwner {
        tokenPrice = price;
    }

    function setPaymentToken(address tokenAddress) public onlyOwner {
        paymentToken = IERC20(tokenAddress);
    }

    function withdrawMatic() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No MATIC to withdraw");
        payable(_msgSender()).transfer(balance);
    }

    function withdrawToken() public onlyOwner {
        uint256 balance = paymentToken.balanceOf(address(this));
        require(balance > 0, "No token to withdraw");
        paymentToken.transfer(_msgSender(), balance);
    }

    function _startTokenId() internal pure override returns (uint256) {
        return 10001;
    }

    function _msgSender() internal view override returns (address sender) {
        return ContextMixin.msgSender();
    }

    // Access Control

    function isMinter(address account) public view returns (bool) {
        return _minters[account];
    }

    function addMinter(address account) public onlyOwner {
        require(account != address(0), "Minter cannot be the zero address");
        require(!_minters[account], "Minter already added");

        _minters[account] = true;
        emit MinterAdded(account);
    }

    function removeMinter(address account) public onlyOwner {
        require(account != address(0), "Minter cannot be the zero address");
        require(_minters[account], "Minter not added");

        _minters[account] = false;
        emit MinterRemoved(account);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    // Overrides

    function _afterTokenTransfers(
        address from,
        address to,
        uint256 startTokenId,
        uint256 quantity
    ) internal override {
        super._afterTokenTransfers(from, to, startTokenId, quantity);

        if (from == address(0) && totalSupply() == maxSupply) {
            _unlock();
        }
    }

    function _approve(
        address to,
        uint256 tokenId,
        address owner
    ) internal override {
        if (to == address(0) || !locked()) {
            super._approve(to, tokenId, owner);
        }
    }

    function _setApprovalForAll(
        address owner,
        address operator,
        bool approved
    ) internal override whenNotLocked {
        super._setApprovalForAll(owner, operator, approved);
    }
}
